    /**
     * Normalize a double d to a value from zero to num.<br>
     *     This assumes that the value d was generated by a FastNoise instance using SimplexFractal noise type with 4 Octaves.
     * @param d The value to be normalized.
     * @param num The maximum value.
     * @return The normalized value.
     */
    public static int normalize(double d, int num) {
        int start = 0;
        int end = NormalizationUtil.normalMap.length - 1;
        while (start + 1 < end) {
            int mid = start + (end - start) / 2;
            if (NormalizationUtil.normalMap[mid] <= d) {
                start = mid;
            } else {
                end = mid;
            }
        }
        double left = Math.abs(NormalizationUtil.normalMap[start] - d);
        double right = Math.abs(NormalizationUtil.normalMap[end] - d);
        if (left <= right) {
            return start * (num) / (normalMap.length);
        }
        return end * (num) / (normalMap.length);
    }
